module.exports = JSON.parse("{\"1\":{\"heading\":\"1. INTRODUCTIE\",\"p1\":\"Deze app is gepubliceerd door SubReader ApS, {{CVR}} met de locatie {{address}} (“Bedrijf”).\",\"p2\":\"Door de app: “SubReader” (“de App”) te gebruiken, gaat u ermee akkoord gebonden te zijn aan de volgende algemeene voorwaarden (“Algemene Voorwaarden”). Als u vragen heeft over het juiste gebruik van de App, neem dan contact met ons op zoals aangegeven in paragraaf 5 van deze Algemene Voorwaarden. Als u niet akkoord gaat met deze algemene voorwaarden, stop dan onmiddellijk met het gebruik van de App.\",\"p3\":\"SubReader behoudt zich het recht om de Algemene Voorwaarden van de App te allen tijde en met onmiddellijke ingang te wijzigen.\"},\"2\":{\"heading\":\"2. ALGEMENE REGELS VOOR HET GEBRUIK VAN DE APP\",\"p1\":\"De App mag niet gebruikt worden voor commerciële doeleinden zonder schriftelijke toestemming van het Bedrijf. De App mag niet illegaal gebruikt worden en op geen enkele wijze illegale activiteiten of illegale doeleinden aanmoedigen. Bij het gebruik van de App wordt de Nederlandse en de internationale wetgeving nageleeft, inclusief de wetten die van toepassing zijn in uw thuisland (gezamenlijk aangeduid als ''Geldende Wetten''). \",\"p2\":\"Bovendien stemt u ermee in om niet:\",\"list\":[\"Proberen om ongeautoriseerde toegang te krijgen tot de App, netwerken, servers of computersystemen die aan de App gekoppeld zijn. \",\"Proberen om de App en de hieraan gerelateerde softwaresystemen die gekoppeld zijn aan SubReader of geïntegreerde platformen te wijzigen, aan te passen, te vertalen of reverse engineering toe te passen.\"],\"p3\":\"U stemt er ook mee in om kosten voor o.a. verliezen en schade van het Bedrijf volledig te vergoeden die ontstaan als u als gebruiker direct of indirect in conflict bent met de Algemene Voorwaarden of de Geldende Wetten als gevolg van uw gebruik van de App.\"},\"3\":{\"heading\":\"3. MATERIAAL EN CONTENT\",\"p1\":\"Het auteursrecht op de content van de App inclusief (grafische) afbeeldingen, geluid, broncode en de opmaak hiervan, evenals ander materiaal (“Materiaal”) is eigendom van het Bedrijf. Alle rechten voorbehouden. Het Materiaal mag gebruikt worden voor eigen gebruik of om de functionaliteit van de app te demonstreren, maar het mag niet gekopieerd, herverdeeld, bewerkt aangepast, vertaald of commercieel geëxploiteerd worden zonder de uitdrukkelijke toestemming van het Bedrijf.\",\"p2\":\"Als gebruiker van de app ben je zelf verantwoordelijk voor het akkoord gaan en voldoen aan de algemene gebruiksvoorwaarden voor het gebruik van de mediadienst voor de levering van multimedia-content (“Mediabureau”), waarvoor je de App gebruikt. Het Bedrijft wijst elke verantwoordelijkheid af voor eventuele schendingen van de algemene voorwaarden van het Mediabureau.\"},\"4\":{\"heading\":\"4. PERSOONLIJKE GEGEVENS EN MARKETING\",\"p1\":\"Door een gebruiker aan te maken met bijbehorende informatie: naam, e-mail en geboortedatum (hieronder aangegeven ''Gebruikersgegevens''), verklaart u akkoord te gaan met het volgende gebruik van uw gebruikersgegevens en met informatie over uw gebruik van de App, bestaande uit gebruikstijden en informatie van het Mediabureau (''Gebruiksgegevens'').\",\"list\":[\"Het Bedrijf en de bijbehorende Mediabureaus kunnen nieuwsbrieven verzenden met updates in relatie tot het gebruik van de App naar het e-mailadres vermeldt in uw Gebruikersgegevens.\",\"Het Bedrijf en de bijbehorende Mediabureaus mogen Gebruikersgegevens gebruiken die aan de gebruiker gekoppeld zijn voor marketingcampagnes, systeemverbeteringen en optimalisatie van de gebruikservaring.\",\"Het Bedrijf kan de Gebruikersgegevens gebruiken in verband met marketingcampagnes voor derden in relatie tot de verspreiding van ondersteuning van andere Mediabureaus.\"]},\"5\":{\"heading\":\"5. VRAGEN VOOR HET BEDRIJF\",\"p1\":\"Alle vragen en berichten aan het Bedrijf met betrekking tot de App kunnen gesteld en verzonden worden met behulp van de onderstaande contactgegevens:\",\"email\":\"Email:\",\"tlf\":\"Telefoon: \",\"aps\":\"SubReader ApS\",\"att\":\"Ter attentie van Klantenservice\"},\"seoTitle\":\"Algemene voorwaarden\",\"seoDescription\":\"Hier kan u meer lezen over de algemene voorwaarden met betrekking tot de SubReader website en de app.\",\"title\":\"Algemene voorwaarden\",\"4-1\":{\"heading\":\"4.1. Welke persoonlijke informatie verzamelen wij?\",\"p1\":\"We verzamelen informatie om in staat te zijn om u gesproken ondertiteling te bieden. Dat houdt in dat we zowel persoonlijke informatie als 'andere' informatie verzamelen.\",\"list\":[\"Informatie die u aan ons geeft: wanneer u een account aanmaakt via de app, registreren wij de accountgegevens. Bijvoorbeeld naam, e-mailadres, wachtwoord, land en locatie. We kunnen ook de locatie registreren.\",\"Informatie die we automatisch verzamelen als u SubReader gebruikt: als u SubReader gebruikt, registreren we automatisch een reeks van informatie, inclusief persoonlijke informatie en informatie over hoe u de service gebruikt. Deze informatie is essentieel om te zorgen voor de beste communicatie tussen u als gebruiker en ons als bedrijf.\",\"Wanneer u deelneemt aan enquêtes, prijsvragen of weggeefacties, verzamelen we contact- en demografische gegevens en andere informatie waar u ons toestemming voor gegeven heeft. We kunnen wedstrijden, weggeefacties en andere aanbiedingen ondersteunen waarbij we mogelijk vragen om persoonlijke gegevens, zoals naam, e-mailadres, telefoonnummer, leeftijd en andere informatie die relevant kan zijn voor deelname.\",\"Wanneer u inlogt via sociale media, kunnen we account- of profielinformatie verzamelen. Het is mogelijk om in te loggen of een account aan te maken voor de service via Facebook of andere sociale media. Wanneer u uw sociale media account koppelt, verzamelen we persoonsgegevens waarvoor u toegang gegeven hebt via uw sociale media profiel. Als u inlogt met uw Facebook-inloggegevens, geeft u ons toestemming om persoonlijke gegevens van uw Facebook-profiel te verzamelen, waarop de algemene voorwaarden van Facebook van toepassing zijn, zoals uw e-mailadres. Als u deze informatie niet met ons wilt delen, bent u genoodzaakt om de instellingen op uw sociale media te wijzigen.\",\"Als u gebruik maakt van onze service, verzamelen we informatie over uw gebruikersgedrag op het platform. We verzamelen automatisch logdata en appartaatinformatie. We maken gebruik van cookies en andere vergelijkbare technologieën. SubReader verzamelt informatie met betrekking tot de betalingen in het SubReader platform. Deze informatie is nodig om het contract tussen u en SubReader in stand te houden.\"]},\"4-2\":{\"heading\":\"4.2. Hoe gebruiken wij uw persoonlijke gegevens?\",\"p1\":\"Wij gebruiken de gegevens om ons bedrijf te runnen, ons platform op de markt te brengen, nieuwe diensten te ontwikkelen en u een persoonlijke ervaring te bieden als u de app gebruikt. We gebruiken de gegevens ook om met u te communiceren.\",\"p2\":\"We gebruiken de informatie voor het volgende:\",\"list\":[\"Het runnen van ons bedrijf en het uitvoeren van onze diensten. We gebruiken uw persoonlijke gegevens om uw persoonlijke account te creëren en te beheren, en daarnaast om uw bestellingen te beheren.\",\"We personaliseren uw ervaring met onze dienst, we krijgen inzicht in het gebruik en begrijpen onze gebruikers beter. We gebruiken de persoonlijke informatie om analyses te maken die de functionaliteit van onze service kunnen verbeteren. We kunnen zowel de interacties met het platform, de aankoopgeschiedenis en voorkeuren gebruiken, en daarnaast ook soortgelijke informatie die u naar het SubReader platform stuurt.\",\"Communiceren met de gebruiker en verzoeken bewaren. Wanneer u zich bij ons registreert, geeft u ons toestemming om met u te communiceren via e-mail of push notificiaties. We kunnen persoonlijke informatie gebruiken om met de gebruiker te communiceren over SubReader producten of diensten die de gebruiker gekocht heeft of om hen te informeren over andere producten, campagnes of diensten waarvan wij denken dat de gebruiker daar mogelijk geïnteresseerd in is. U kunt altijd zelf de manier waarop wij met u communiceren wijzigen in uw accountvoorkeuren op de website. We gebruiken persoonlijke gegevens ook om technische ondersteuning en assistentie op het platform te bieden. Dat omvat toegang tot uw SubReader account om technische vragen te beantwoorden. Wij kunnen e-mails sturen, zelfs als u zich hiervoor afgemeld hebt, met betrekking tot updates van onze algemene voorwaarden.\",\"Personaliseren van advertenties en marketing. Wij gebruiken persoonlijke en andere informatie om reclame- en marketingcampagnes te sturen die informatie geven over producten waarvan wij denken dat deze het meest relevant zijn voor de gebruiker. Gebaseerd op het feit dat u ons toestemming heeft gegeven om u berichten te sturen voor marketing- en reclamedoeleinden, of andere informatie, gebruiken we uw voorkeuren en informatie (ook op sociale media) om berichten te verzenden met inhoud waarvan wij denken dat deze het beste bij u past. U hebt altijd de mogelijkheid om u af te melden voor alle vormen van marketing van SubReader.\"]},\"4-3\":{\"heading\":\"4.3. Waar worden persoonlijke gegevens opgeslagen?\",\"p1\":\"SubReader maakt gebruik van een aantal verschillende externe serviceproviders om te helpen bij het aanbieden van services die gerelateerd zijn aan het SubReader platform. Deze serviceproviders kunnen zich zowel binnen als buiten de Europese Economische Ruimte bevinden (''EER''). Elke overdracht met persoonlijke gegevens gebeurt in overeenstemming met de betreffende wetten.  \",\"p2\":\"Deze serviceproviders hebben alleen beperkte toegang tot de gegevens om namens ons taken uit te voeren. Zij zijn met het contract gebonden aan het beschermen en uitsluitend gebruiken van de gegevens voor het overeengekomen doel en dat wat in overeenstemming is met deze voorwaarden. Wij hebben, voor we de data met derden gedeeld hebben, de noodzakelijke maatregelen genomen om gegevensbescherming te garanderen. Dit is gebaseerd op de EU Modelclausules. Dit is een reeks clausules uitgegeven door de Europse Commissie.\"},\"4-4\":{\"heading\":\"4.4. Hoe lang worden uw persoonlijke gegevens bewaard?\",\"p1\":\"SubReader bewaart de gegevens zo lang als dat u een account bij ons hebt of onze diensten gebruikt.  We bewaren en gebruiken gegevens ook om te voldoen aan onze wettelijke richtlijnen en om geschillen op te lossen.\"},\"4-5\":{\"heading\":\"4.5. Wie is er verantwoordelijk voor uw persoonlijke gegevens?\",\"p1\":\"SubReader ApS is de gegevensverwerker van de gegevens die u ons stuurt en is verantwoordelijk voor de gegevens. \"},\"4-6\":{\"heading\":\"4.6. Wie geeft er toegang tot uw persoonlijke gegevens?\",\"p1\":\"De gegevens kunnen gedeeld worden in SubReader ApS en haar dochteronderneming en zusterbedrijf, die gerelateerd zijn aan normaal eigendom of controle. Wij versturen, verkopen of ruilen de gegevens nooit aan derden buiten de SubReader ApS groep in ruil voor marketingactiviteiten. Gegevens die aan derden doorgegeven worden, worden uitsluitend gebruikt om de bovengenoemde diensten te verlenen. Denk bijvoorbeeld aan mediabureaus om nieuwsbrieven uit te sturen, kredietreferenties of met het doel om een kredietbeoordeling, identiteitscontrole of incasso uit te voeren.\"},\"4-7\":{\"heading\":\"4.7. Hoe beschermen we uw gegevens?\",\"p1\":\"Wij maken gebruik van technische en organisatorische processen om de gegevens te beschermen tegen verlies, manipulatie of toegang door onbevoegde personen. Wij blijven initiatieven opnemen die de technologische ontwikkelingen volgen. Om de betaling bij ons zo gemakkelijk mogelijk te maken, gebruiken we versleutelde formules. Dit betekent dat de betalingsinformatie via een beveiligde verbinding wordt verzonden en dat externe partners geen toegang hebben tot de persoonlijke gegevens. Als u met een betaalkaart betaalt, werken we met betalingsverwerkers die ons helpen om direct na te kunnen gaan bij de bank of de kaart gevalideerd is voor aankopen. Onze betalingsverwerkers verwerken de kaartgegevens in overeenstemming met de internationale beveiligingsstandaard PCI DSS, die ontwikkeld is door de creditkaartmaatschappijen VISA, MasterCard, Diners, American Express en JCB. Dit betekent dat uw betaalkaart verwerkt wordt met een zeer hoog beveiligingsniveau. Als u met een betaalkaart betaalt, behouden wij het recht om een identiteitscontrole uit te voeren.\"},\"4-8\":{\"heading\":\"4.8. Wat zijn uw rechten en mogelijkheden om bezwaar te maken?\",\"p1\":\"U heeft het recht om geïnformeerd te worden over de persoonsgegevens die wij van u verwerken. U kan ook te allen tijde bezwaar maken tegen het gebruik van informatie. U kunt uw toestemming voor de verwerking van informatie over u intrekken. Als de over u verwerkte informatie onjuist is, heeft u het recht om deze te laten corrigeren of verwijderen. Vragen hierover kan u sturen naar:\",\"p2\":\"Als u een klacht wilt indienen over onze verwerking van uw persoonsgegevens, heeft u ook de mogelijkheid om contact met ons op te nemen via:\",\"email\":\"contact@subreader.nl\",\"link\":{\"content\":\"Gegevenstoezicht\",\"href\":\"https://autoriteitpersoonsgegevens.nl/nl\"}}}");

